고대 이집트 풍미와 업데이트된 규칙이 있는 클래식 보드 게임입니다. 모든 움직임이 상대방을 이기는 데 한 걸음이 되는 고대 피라미드의 분위기에 푹 빠져보세요. 전략적 기술을 개발하고, 상대방의 행동을 예상하고, 위치를 방어하고, 말을 승리로 이끌어 파라오를 체크메이트하세요!

게임에서는 세 가지 난이도를 제공하는 가상의 상대와, 한 기기에서 친구와 함께 싸울 수 있습니다. 목표는 간단합니다. 적을 속이고, 그의 말을 파괴하고, 파라오의 왕좌를 차지하는 것입니다. 기술을 연마하고, 논리적 사고력을 개발하고, 고대 이집트의 가장 위대한 전략가가 되세요!

게임 기능
• 세 가지 난이도를 제공하는 똑똑한 가상의 상대;
• 고대 이집트 문화의 정신을 담은 독특한 양식화된 그래픽;
• 한 기기에서 친구와 함께 플레이할 수 있는 기능;

진짜 고대 사령관처럼 느끼고 이집트의 통치자가 될 자격이 있음을 증명하세요!
